import React from 'react';
import TodoItem from './TodoItem';
import todoData from "./todoList";
import Header from './Header'

function App() {
    const todoList = todoData.map(task => <TodoItem key={task.id} data={task}/>);

    return (
        <div className="bkgrnd">
            <Header />

            <div className="task-list">
                {todoList}
            </div>
        </div>
    )
}

export default App;
